import React from 'react';
import Header from './Findztask/Header';
import Main from './Findztask/Main';
import Moviedetails from './Findztask/Moviedetails';
import {BrowserRouter,Routes,Route,Fragment} from 'react-router-dom'; 

function App() {
  return (
  <>
  <div className="container">
 <Header/>
	<BrowserRouter>
	  <Fragment>
	  <Routes>

				  <Route exact path='/moviedetails' element={<Moviedetails/>}/>


	  </Routes>
	  </Fragment>
	   <Main/>
	</BrowserRouter>

 </div>

  </>
  );
}

export default App;
